import React, { useState, useContext } from "react";
import axios from 'axios';
import { useNavigate } from "react-router-dom";
import { AuthContext } from '../components/AuthContext';
import {
  Button,
  Form,
  FormGroup,
  Label,
  Input,
} from "reactstrap";
import loginImg from "../components/login.svg";
import 'bootstrap/dist/css/bootstrap.min.css';
import "../components/login.css";

function Login() {
  const [credentials, setCredentials] = useState("");
  const { login } = useContext(AuthContext);
  const [loading, setLoading] = useState(false);
  const navigate = useNavigate();

  const handleChange = (e) => {
    setCredentials(e.target.value);
  };

  const handleSubmit = async (event) => {
    event.preventDefault();
    setLoading(true);

    try {
      const response = await axios.post(`https://localhost:7116/api/controller/login?gstNo=${credentials}`);

      if (response.status === 200) {
        login(response.data.token);
        axios.defaults.headers.common['Authorization'] = `Bearer ${response.data.token}`;
        navigate('/dashboard');
        console.log('User logged in successfully');
      } else {
        console.log('Login failed');
      }
    } catch (error) {
      console.error('Error:', error);
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="container-fluid vh-100 d-flex align-items-center justify-content-center">
      <div className="row">
        <div className="col-lg-6 d-none d-lg-flex align-items-center justify-content-center bg-light">
          <div className="text-center">
            <h2>Invoice Management</h2>
            <img className="mt-4" src={loginImg} alt="mobile-App" />
          </div>
        </div>
        <div className="col-lg-6 d-flex align-items-center">
          <Form className="w-100" onSubmit={handleSubmit}>
            <h2 className="font-weight-bold mb-4 text-center">Login</h2>
            <FormGroup className="mb-3">
              <Label className="font-weight-bold">Enter GST Number</Label>
              <Input
                type="text"
                placeholder="GST No"
                value={credentials}
                onChange={handleChange}
                required
              />
            </FormGroup>
            <Button type="submit" className="btn btn-primary w-100" disabled={loading}>
              {loading ? 'Logging In...' : 'Log In'}
            </Button>
            <div className="text-center mt-3">
              Do not have an account? <a href="/register">Sign Up</a>
            </div>
          </Form>
        </div>
      </div>
    </div>
  );
}

export default Login;
